import React from 'react';
import CardList from './CardList';
import SearchBox from './Searbox';
import { robots } from './robots';


const App = () => {
	return (
		<div>
			<h1>RoboFriends</h1>

			<CardList robots={robots} />
		</div>
	);
}

export default App;
